class Solution(object):
    def smallestDistancePair(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        chars = sorted(nums)
        numList = []
        countList = []
        previous = chars[0]
        count = 1
        for i in xrange(1,len(chars)):
            if chars[i] == previous:
                count += 1
            else:
                numList.append(previous)
                countList.append(count)
                previous = chars[i]
                count = 1
        numList.append(previous)
        countList.append(count)
        
        
        import heapq
        heap = []
        length = len(numList)
        for i in xrange(length):
            for j in xrange(i,length):
                if j == i and countList[i] > 0:
                    distance = numList[j] - numList[i]
                    number = countList[i]*(countList[i]-1)/2
                    if number < k:
                        k = k - number
                    else:
                        for _ in xrange(countList[i]*(countList[i]-1)/2):
                            if len(heap) < k:
                                heapq.heappush(heap,-1 * distance)
                            else:
                                minValue = heapq.heappop(heap)
                                if distance < (-1 * minValue):
                                    heapq.heappush(heap,-1 * distance)
                                else:
                                    heapq.heappush(heap, minValue)
                else:
                    distance = numList[j] - numList[i]
                    number = countList[i]*countList[j]
                    if number < k:
                        k = k - number
                    else:
                        for _ in xrange(countList[i]*countList[j]):
                            if len(heap) < k:
                                heapq.heappush(heap,-1 * distance)
                            else:
                                minValue = heapq.heappop(heap)
                                if distance < (-1 * minValue):
                                    heapq.heappush(heap,-1 * distance)
                                else:
                                    heapq.heappush(heap, minValue)
        return -1 * heapq.heappop(heap)
        #return heap
        
